:"The Wassily Chair also known as the Model B3 chair was designed by Marcel Breuer in 19251926 while he was the head of the cabinet-making workshop at the Bauhaus in Dessau Germany.";i:1;s:31:"Wassily chair by Marcel Breuer.";i:2;s:63:"Marcel Breuer Faltsessel Chair D4 1927 from the Bauhaus Dessau.";i:3;s:180:"The Wassily Chair also known as the Model B3 chair was designed by Marcel Breuer in 1925-1926 while he was the head of the cabinet-making workshop at the Bauhaus in Dessau Germany.";i:4;s:198:"The chair later known as the Wassily was first manufactured in the late 1920s by Thonet the German-Austrian furniture manufacturer most known for its bent-wood chair designs under the name Model B3.";i:5;s:67:"It was first available in both a folding and a non-folding version.";i:6;s:180:"The Wassily Chair also known as the Model B3 chair was designed by Marcel Breuer in 1925-1926 while he was the head of the cabinet-making workshop at the Bauhaus in Dessau Germany.";i:7;s:146:"Despite popular belief the chair was not designed for the non-objective painter Wassily Kandinsky who was on the Bauhaus faculty at the same time.";i:8;s:135:"Initially the Wassily Chair was produced by the company founded by Breuer of Standard-Mobel Lengyel in 1929 that is absorbed by Thonet.";i:9;s:101:"The Thonet produced version of the chair is most rare and went out of production during World War II.";i:10;s:186:"After the war decades Gavina picked up the license for the Wassily along with the Breuer designs previously sold by Standard-Möbel Lengyel Co and introduced the more recognized Wassily.";i:11;s:167:"Wassily Chairs by Marcel Breuer 19251926 Berlin In late 1932 Mies rented a derelict factory in Berlin Birkbusch Street 49 to use as the new Bauhaus with his own money.";i:12;s:80:"The students and faculty rehabilitated the building painting the interior white.";i:13;s:84:"The school operated for ten months without further interference from the Nazi Party.";i:14;s:64:"DictWiki ⓿ Wassily ch